/* Home.js */

import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <section className="home-section">
      <div className="row">
        {/* Column 1: Home Page Content */}
        <div className="col-md-6 d-flex justify-content-center flex-column">
          <div className="home-content">
            <h2 className="home-title">Welcome to My Portfolio</h2>
            <p className="home-description">
              I'm SAP Certified Application Associate - Sales and Distribution with SAP ERP 6.0 EhP7
            </p>
            <button className="explore-button">Explore My Resume</button>
          </div>
        </div>

        {/* Column 2: Contact Information */}
        <div className="col-md-6 d-flex justify-content-center align-items-center">
          <div className="contact-info">
            <h3>Contact Me</h3>
            <p>
              <strong>Email:</strong> <a href="mailto:prakashpansare302@gmail.com">prakashpansare302@gmail.com</a>
            </p>
            <p>
              <strong>LinkedIn:</strong>{' '}
              <a href="https://www.linkedin.com/in/pradumnya-pansare-59b6b3212/" target="_blank" rel="noopener noreferrer">
                LinkedIn Profile
              </a>
            </p>
            <p>
              <strong>Phone:</strong> 9082423154
            </p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
